	"topup": ["To continue, please reduce your bet size or top up your account.", "للمتابعة، يُرجى تخفيض مبلغ رهانك أو شحن حسابك.", "За да продължите, намалете размера на залога или заредете сметката си.", "Chcete-li pokračovat, snižte velikost sázky nebo dobijte svůj účet.", "For at fortsætte skal du reducere din indsats eller indbetale flere penge på din konto.", "Um fortzufahren, verringern Sie bitte Ihren Einsatz oder erhöhen Sie Ihr Kontoguthaben.", "Για να συνεχίσετε, μειώστε το ποσό του στοιχήματός σας ή ανανεώστε τον λογαριασμό σας.", "Para continuar, por favor, reduzca el tamaño de su apuesta o recargue su cuenta.", "Jätkamiseks vähenda palun oma panuse suurust või lisa oma kontole raha.", "برای ادامه، لطفا میزان شرط خود را کم کرده یا حساب خود را شارژ کنید.", "Jatkaaksesi, vähennä panoskokoasi tai tee talletus", "Pour continuer, veuillez réduire le montant de votre mise ou approvisionner votre compte.", "Ako želite nastaviti, smanjite iznos uloga ili nadoplatite račun.", "A folytatáshoz kérjük, csökkentse a tét értékét vagy töltse fel egyenlegét.", "Շարունակելու համար, նվազեցրեք ձեր խաղադրույքը կամ համալրեք ձեր հաշիվը։", "Untuk melanjutkan, kurangi ukuran taruhan Anda atau tambah saldo akun Anda.", "Per proseguire, riduci la dimensione della tua puntata o ricarica il tuo conto.", "続けるには、ベットを減らすか、アカウントに資金を追加してください。", "გასაგრძელებლად შეამცირეთ ფსონის ოდენობა ან შეავსეთ თქვენი ანგარიში.", "계속하려면 베팅 규모를 줄이거나 계정에 입금하세요", "Jei norite tęsti, sumažinkite statymo dydį arba papildykite savo sąskaitą.", "Lai turpinātu, lūdzu, samazini likmes apjomu vai papildini savu kontu.", "Untuk teruskan, sila kurangkan saiz taruhan atau tambah nilai akaun anda.", "Om door te gaan, verlaag uw inzet of voeg saldo toe aan uw account.", "For å fortsette, reduser innsatsen eller fyll på spillekontoen.", "Aby kontynuować, zmniejsz wysokość zakładu lub doładuj swoje konto.", "Para continuar, reduza o valor da sua aposta ou carregue a sua conta.", "Чтобы продолжить, уменьшите размер ставки или пополните счет.", "Pre pokračovanie znížte výšku stávky alebo dobite svoj účet.", "Da biste nastavili, smanjite veličinu uloga ili dopunite svoj nalog.", "För att fortsätta, vänligen minska din insatsstorlek eller fyll på ditt konto.", "หากต้องการดำเนินการต่อ โปรดลดจำนวนเงินเดิมพันของคุณหรือเติมเงินในบัญชี", "Para magpatuloy, pakibawasan ang laki ng iyong taya o magdagdag ng pondo sa iyong account.", "Devam etmek için lütfen bahis miktarını azaltın veya hesabınıza para yatırın.", "Щоб продовжити, зменшіть розмір ставки або поповніть рахунок.", "Để tiếp tục, vui lòng giảm mức cược hoặc nạp tiền vào tài khoản của bạn.", "要继续，请减小赌注大小或为账户充值。", "要繼續，請減小賭注大小或為帳戶充值。", "Pentru a continua, scadeti miza sau alimentati contul", "চালিয়ে যেতে, অনুগ্রহ করে আপনার বেট কমান বা অ্যাকাউন্ট টপ-আপ করুন।"],
